const ChatHeader = () => {
  return (
    <div className="chatHeader">
      <div className="chatHeader__left">
        <h3>
          <span className="chatHeader__hash">#</span>
          Udemy
        </h3>
      </div>
      <div className="chatHeader__right">
        <NotificationsIcon />
        <PushPinIcon />
      </div>
    </div>
  );
};

export default ChatHeader;
